import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
    inputContainer: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        paddingHorizontal: 20,
    },
    input: {
        width: '80%',
        borderBottomWidth: 1,
        borderBottomColor: '#7D8CC4',
    },
});
